measurements.description:
Fifteen flowers and 23 buds well-distributed on an upright branched inflorescence of 22cm; 
  sepals and petals white striped pink, petals lightly flushed pink;

lip white, side lobes striped pink, midlobe darker pink, central callus bright yellow; 
column flushed dark pink, anther cap white;
 substance medium; 
texture diamond dust.
